      SELECT col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE NULL NOT BETWEEN col2 * ( - CAST ( col0 AS INTEGER ) ) AND - ( - col1 ) + - - ( + col2 ) * - col1 * 19;
  - name: tab2

outputs:
  - name: q2369.out
    data: |
